import {AuthContext} from './context/AuthContext'
import 'materialize-css'

function App() {
  // const {token, userId, login, logout} = useAuth()
  // const isAuthenticated = !!token
  const routes = useRoutes(false)

  return (
    // <AuthContext.Provider value={{
